export class Person {
    constructor(_name) {
        this.name = 'No Name';
        this.name = _name;
        console.log('Constructing Person');
    }
    static async build(_name) {
        const tmpPerson = new Person(_name);
        tmpPerson.name = 'modified in build';
        return tmpPerson;
    }
    // * The Person is born!
    changeSelf() {
        this.name = "SELF NAME";
    }
}
